import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import pic1 from "../Images/right.webp"; // ✅ Correct Path

const Home = () => {
  return (
    <div className="container mt-4">
      <div className="row align-items-center">
        {/* Left Column (Text & Services) */}
        <div className="col-md-5">
          <div className="p-3 border rounded shadow-lg bg-light" style={{ maxWidth: "90%", margin: "auto" }}>
            <h4 className="mb-2 text-center">Home Services at Your Doorstep</h4>
            <p className="mb-3 text-center small">What are you looking for?</p>

            {/* Services Grid (Smaller size) */}
            <div className="row g-2">
              {[
                { img: "https://cdn-icons-png.flaticon.com/512/2867/2867281.png", text: "Women's Salon & Spa" },
                { img: "https://cdn-icons-png.flaticon.com/512/2867/2867316.png", text: "AC & Appliance Repair" },
                { img: "https://cdn-icons-png.flaticon.com/512/2867/2867294.png", text: "Cleaning Services" },
                { img: "https://cdn-icons-png.flaticon.com/512/2867/2867284.png", text: "Plumbing Services" },
                { img: "https://cdn-icons-png.flaticon.com/512/2867/2867301.png", text: "Electrical Repairs" },
                { img: "https://cdn-icons-png.flaticon.com/512/2867/2867312.png", text: "Carpentry Services" },
                { img: "https://cdn-icons-png.flaticon.com/512/2867/2867306.png", text: "Painting Services" },
                { img: "https://cdn-icons-png.flaticon.com/512/2867/2867308.png", text: "Pest Control" },
                { img: "https://cdn-icons-png.flaticon.com/512/2867/2867296.png", text: "Home Shifting" },
              ].map((service, index) => (
                <div key={index} className="col-4 text-center">
                  <div className="p-2 border rounded shadow-sm bg-white">
                    <img
                      src={service.img}
                      alt={service.text}
                      className="img-fluid mb-1"
                      style={{ width: "35px" }}
                    />
                    <p className="mb-0 small">{service.text}</p>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>

        {/* Right Column (Image) */}
        <div className="col-md-5 text-center">
          <img
            src={pic1}
            alt="Home Services"
            className="img-fluid rounded"
            style={{ maxHeight: "300px" }}
          />
        </div>
      </div>
    </div>
  );
};

export default Home;
